import React, { Component } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';

export class SewaMobil extends Component {
  render() {
    return (
      <Map
        google={this.props.google}
        zoom={14}
        initialCenter={{
          lat: 37.7749,
          lng: -122.4194
        }}
      />
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyAKpP1k4QOJkEhsflDGUwTDoetDjklA83E'
})(SewaMobil);
